use super::*;

fn get1() -> Space {
    Space::new(
        "space1",
        CoordinateSystem::new(
            vec![0f64, 0f64, 0f64],
            vec![
                Axis::new(
                    "cm",
                    vec![1f64, 0f64, 0f64],
                    NumberSet::N,
                    -40f64,
                    40f64,
                    80,
                )
                .unwrap(),
                Axis::new(
                    "cm",
                    vec![0f64, 1f64, 0f64],
                    NumberSet::N,
                    -40f64,
                    40f64,
                    80,
                )
                .unwrap(),
                Axis::new(
                    "cm",
                    vec![0f64, 0f64, 1f64],
                    NumberSet::N,
                    -40f64,
                    40f64,
                    80,
                )
                .unwrap(),
            ],
        ),
    )
}

