#[test]
pub fn test() {
    //FIXME: Split this test into multiple unit tests.
    let s_1 = get1();
    let s_2 = get2();
    let s_3 = get3();
    let s_u = Space::universe();

    // Position([CoordinateF64(30.0), CoordinateF64(10.0), CoordinateF64(-37.0)]) in Space1
    let p_1: Position = vec![
        Coordinate::CoordinateU8(7),
        Coordinate::CoordinateU8(7),
        Coordinate::CoordinateU8(7),
    ]
    .into();

    // Make sure to be at most at -37 on Z, as this the lowest value on space2 Z axis
    let p_2: Position = vec![
        Coordinate::CoordinateU8(70),
        Coordinate::CoordinateU8(50),
        Coordinate::CoordinateU8(3),
    ]
    .into();

    // Position([CoordinateF64(-17.0), CoordinateF64(-17.0), CoordinateF64(-17.0)]) in Universe (Absolute positions)
    let p_3: Position = vec![
        Coordinate::CoordinateF64(-17.0),
        Coordinate::CoordinateF64(-17.0),
        Coordinate::CoordinateF64(-17.0),
    ]
    .into();

    // Position([CoordinateF64(1.0), CoordinateF64(0.0), CoordinateF64(0.0)]) in Space3
    // The zero point is at encoded value [4000, 400, 40] in space3!
    let p_r: Position = vec![
        Coordinate::CoordinateU32(4500),
        Coordinate::CoordinateU32(400),
        Coordinate::CoordinateU32(40),
    ]
    .into();

    let shape_o = Shape::Point(p_2.clone());
    let shape_u = Shape::Point(p_3.clone());
    let shape_r = Shape::Point(p_r.clone());

    // Change reference space, but does not change the absolute position of the
    // point.
    let shape_t = shape_o.rebase(&s_1, &s_2).unwrap();

    assert_eq!(
        format!("{:?}", shape_o),
        "Point(Position3([CoordinateU8(70), CoordinateU8(50), CoordinateU8(3)]))"
    );
    assert_eq!(
        format!("{:?}", shape_t),
        "Point(Position3([CoordinateU64(16140901064495857664), CoordinateU64(11990383647911208960), CoordinateU8(0)]))"
    );

    // Check decoding of the coordinates work as expected.
    assert_eq!(
        format!("{:?}", s_1.decode(&shape_o.rasterise().unwrap()[0])),
        "Ok([30.0, 10.0, -37.0])"
    );
    assert_eq!(
        format!("{:?}", s_2.decode(&shape_t.rasterise().unwrap()[0])),
        "Ok([30.0, 12.0, -40.0])"
    );
    assert_eq!(
        format!("{:?}", s_3.decode(&shape_r.rasterise().unwrap()[0])),
        "Ok([5.0, 0.0, 0.0])"
    );

    // Check conversion to absolute position work as expected.
    assert_eq!(
        format!("{:?}", shape_o.rasterise_from(&s_1)),
        "Ok([Position3([CoordinateF64(30.0), CoordinateF64(10.0), CoordinateF64(-37.0)])])"
    );
    assert_eq!(
        format!("{:?}", shape_t.rasterise_from(&s_2)),
        "Ok([Position3([CoordinateF64(30.0), CoordinateF64(10.0), CoordinateF64(-37.0)])])"
    );
    assert_eq!(
        format!("{:?}", shape_u.rasterise_from(s_u)),
        "Ok([Position3([CoordinateF64(-17.0), CoordinateF64(-17.0), CoordinateF64(-17.0)])])"
    );
    assert_eq!(
        format!("{:?}", shape_r.rasterise_from(&s_3)),
        "Ok([Position3([CoordinateF64(3.5355339059327373), CoordinateF64(3.5355339059327373), CoordinateF64(0.0)])])"
    );

    // Check the conversion error bounds
    // Exact
    assert_eq!(
        format!(
            "{:?}",
            shape_u
                .rebase(s_u, &s_1)
                .unwrap()
                .rasterise_from(&s_1)
                .unwrap()
        ),
        "[Position3([CoordinateF64(-17.0), CoordinateF64(-17.0), CoordinateF64(-17.0)])]"
    );
    // Exact
    assert_eq!(
        format!(
            "{:?}",
            shape_u
                .rebase(s_u, &s_2)
                .unwrap()
                .rasterise_from(&s_2)
                .unwrap()
        ),
        "[Position3([CoordinateF64(-17.0), CoordinateF64(-17.0), CoordinateF64(-17.0)])]"
    );
    // Up to 2 decimal.
    assert_eq!(
        format!(
            "{:?}",
            shape_u
                .rebase(s_u, &s_3)
                .unwrap()
                .rasterise_from(&s_3)
                .unwrap()
        ),
        "[Position3([CoordinateF64(-17.005918087536465), CoordinateF64(-17.005918087536465), CoordinateF64(-17.0)])]"
    );
}

#[test]
pub fn check_r1() {
    let s = Shape::BoundingBox(
        vec![Coordinate::CoordinateU64(17)].into(),
        vec![Coordinate::CoordinateU64(23)].into(),
    );

    let t1 = s.rasterise().unwrap();

    assert_eq!(format!("{:?}", t1), "[Position1(CoordinateU8(17)), Position1(CoordinateU8(18)), Position1(CoordinateU8(19)), Position1(CoordinateU8(20)), Position1(CoordinateU8(21)), Position1(CoordinateU8(22))]");
}

